import React from "react"
import DroneCard from "./DroneCard.js"
import BookingForm from './BookingForm'
const DroneList = (props) => {
    // console.log(props)
    return (
        <div>
            {/* <h1>{props.name}</h1> */}
            {props.drones.map(drone => <DroneCard drone={drone} showForm={props.showForm} />)}
            {props.showForm ? <BookingForm  addNewConcert={this.addNewConcert}/> : null}
        </div>
    )
}

export default DroneList
